import React, { Component } from "react";
import "./App.css";
import Nav from "./components/Nav";

const HOG_URL = "http://localhost:3000/hogs";

class App extends Component {
  state = {};

  componentDidMount = () => {
    this.fetchHogs();
  };

  render() {
    return (
      <div className="App">
        <Nav />
      </div>
    );
  }
}

export default App;
